import { useEffect, useState } from "react";
import axios from "axios";
import { Link } from "react-router-dom";

function Dashboard() {
  const [employees, setEmployees] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:5000/employees")
      .then((res) => setEmployees(res.data))
      .catch((err) => console.error(err));
  }, []);

  const totalEmployees = employees.length;

  const totalDepartments = [
    ...new Set(employees.map((e) => e.department).filter(Boolean)),
  ].length;

  return (
    <div style={page}>
      {/* Header */}
      <div style={header}>
        <h2 style={{ margin: 0 }}>Admin Dashboard</h2>
        <p style={{ color: "#6b7280", marginTop: "6px" }}>
          Employee Management System
        </p>
      </div>

      {/* Stats */}
      <div style={statsGrid}>
        <div style={card}>
          <p style={cardLabel}>Total Employees</p>
          <h1 style={cardValue}>{totalEmployees}</h1>
        </div>

        <div style={card}>
          <p style={cardLabel}>Departments</p>
          <h1 style={cardValue}>{totalDepartments}</h1>
        </div>

        <div style={card}>
          <p style={cardLabel}>System Status</p>
          <h1 style={{ ...cardValue, color: "#16a34a" }}>Active</h1>
        </div>
      </div>

      {/* Quick Actions */}
      <div style={section}>
        <h3 style={sectionTitle}>Quick Actions</h3>

        <div style={actionGrid}>
          <Link to="/employees" style={actionCard}>
            <h4>Employees</h4>
            <p>View & manage employees</p>
          </Link>

          <Link to="/attendance" style={actionCard}>
            <h4>Attendance</h4>
            <p>Mark & review attendance</p>
          </Link>

          <Link to="/profile" style={actionCard}>
            <h4>Admin Panel</h4>
            <p>System & profile settings</p>
          </Link>
        </div>
      </div>
    </div>
  );
}

/* ================= STYLES ================= */

const page = {
  padding: "32px",
  backgroundColor: "#f8fafc",
  minHeight: "100vh",
};

const header = {
  marginBottom: "32px",
};

const statsGrid = {
  display: "grid",
  gridTemplateColumns: "repeat(auto-fit, minmax(240px, 1fr))",
  gap: "20px",
  marginBottom: "40px",
};

const card = {
  background: "#ffffff",
  borderRadius: "14px",
  padding: "24px",
  boxShadow: "0 10px 25px rgba(0,0,0,0.05)",
};

const cardLabel = {
  fontSize: "14px",
  color: "#6b7280",
  marginBottom: "10px",
};

const cardValue = {
  fontSize: "34px",
  fontWeight: "700",
  margin: 0,
};

const section = {
  marginTop: "10px",
};

const sectionTitle = {
  marginBottom: "18px",
};

const actionGrid = {
  display: "grid",
  gridTemplateColumns: "repeat(auto-fit, minmax(260px, 1fr))",
  gap: "20px",
};

const actionCard = {
  background: "#ffffff",
  borderRadius: "14px",
  padding: "22px",
  textDecoration: "none",
  color: "#111827",
  boxShadow: "0 10px 25px rgba(0,0,0,0.05)",
  transition: "transform 0.2s",
};

export default Dashboard;
